    value: Schedule A supporting Line 11(a)(i) discloses a contribution to Laurence
      Le Jeune that is excessive by $11,000.  Please be advised that on 3/01/09, the
      Republican Party of Minnesota refunded $10,000 to Laurence Le Jeune.  This refund
      is reported on the 2009 April Monthly Report.  Another $1,000 is being refunded
      and will be reported on Line 28(a) of the appropriate report.  The party has
      mailed copies of the refund checks to the FEC.  Schedule B, supporting Line
      21(b) discloses reimbursements to Hayley M Astrup, Gina Lynn Countryman, and
      Angela Nielsen.  Please be advised that the payments to the original vendors
      have not exceeded $200 in a calendar year.  Schedule A supporting Line 12 discloses
      a transfer from McCain Victory 2008. Please be advised that contributions from
      two of the original contributors, Paul Baker and Steven Lippman, exceed the
      Acts contribution limits.  These excessive portion of these contributions were
      returned to the joint fundraising committee on 8/4/2008.  Negative memo entries
      are reflected on the Partys 2008 September Monthly.
